import React from 'react';
import { useLocation } from 'react-router-dom';

function ScorePage() {
  const location = useLocation();
  const { responses, jsonData } = location.state || {};

  if (!jsonData) return <p>Loading...</p>;

  const goodPoints = [];
  const improvementPoints = [];

  jsonData.layers.forEach(layer => {
    layer.topics.forEach(topic => {
      topic.subtopics.forEach(subtopic => {
        subtopic.questions.forEach(q => {
          const response = responses[q.question];
          if (response === 'Yes') {
            goodPoints.push(...q.good_points);
          } else {
            improvementPoints.push(...q.improvement_points);
          }
        });
      });
    });
  });

  return (
    <div>
      <h2>Score</h2>
      <p>Total Score: {goodPoints.length}</p>
      <h3>Good Points</h3>
      <ul>
        {goodPoints.map((point, index) => (
          <li key={index}>{point}</li>
        ))}
      </ul>
      <h3>Areas for Improvement</h3>
      <ul>
        {improvementPoints.map((point, index) => (
          <li key={index}>{point}</li>
        ))}
      </ul>
    </div>
  );
}

export default ScorePage;
